import React from 'react';

const TapFork = () => {
    return (
      <div>
        <Typography className={text.paragraph}>
        Tap & Fork has a website where restaurant owners could build promotions that would be run for specified time intervals, add coupons, and create custom images with a simple and easy-to-use web based graphic editor.Customers use the Tap & Fork mobile application, which features nearby restaurant search. The Tap & Fork mobile application design is what I worked on.
        </Typography>

      </div>
    );
  }


export default TapFork;
